            <label for="radioButton" class="radioImageLabel">
                <div className="container">
                <h1>Selected</h1>
                <img src={Room1} alt="Radio Button" />
                </div>
            </label>

            <input type="radio"  name="radioGroup" value="option2" />
            <label for="radioButton" class="radioImageLabel">
                <div className="container">
                <h1>Selected</h1>
                <img src={Room1} alt="Radio Button" />
                </div>
            </label>
            

            
        </form>
    )
}
